import React from "react";

const Skills = () => {
  return (
    <section id="skills" className="py-20 bg-white">
      <div className="max-w-6xl mx-auto px-6 text-center">
        <h2 className="text-4xl font-bold mb-12">Skills</h2>

        <div className="grid md:grid-cols-3 gap-8">
          
          {/* Programming */}
          <div className="p-6 rounded-2xl shadow-lg bg-gradient-to-r from-indigo-500 to-purple-500 text-white hover:scale-105 transition">
            <h3 className="text-2xl font-semibold mb-4">Programming</h3>
            <p>Python</p>
            <p>Java</p>
            <p>JavaScript</p>
          </div>

          {/* Web */}
          <div className="p-6 rounded-2xl shadow-lg bg-gradient-to-r from-pink-500 to-purple-500 text-white hover:scale-105 transition">
            <h3 className="text-2xl font-semibold mb-4">Web Technologies</h3>
            <p>HTML</p>
            <p>CSS</p>
            <p>React.js</p>
          </div>

          {/* Other */}
          <div className="p-6 rounded-2xl shadow-lg bg-gradient-to-r from-indigo-500 to-blue-500 text-white hover:scale-105 transition">
            <h3 className="text-2xl font-semibold mb-4">Other Skills</h3>
            <p>MySQL</p>
            
            <p>Team Collaboration</p>
          </div>

        </div>
      </div>
    </section>
  );
};

export default Skills;
